import React from 'react'
import Button from './Button'

const list=["All","Gaming","Songs","Live","Soccer","Cricket","Cooking","Valentine"];
const ButtonList = () => {
  return (
    <div className='flex'>
      {list.map((ele)=>{
        return <Button name={ele}/>
      })}
    </div>
  )
}

export default ButtonList
